import './App.css';
import React, { Component } from "react";
import ISSLocation from './components/ISSLocation';
import Header from './components/Header';
import ISSLocationProvider from './context/ISSLocationProvider';

class App extends Component {
  render() {
  return (
    <ISSLocationProvider>
      <div className="App">
        <Header />
        <ISSLocation />
      </div>
    </ISSLocationProvider>
  );
}
}

export default App;
